(6, 'Cardiometabolic Summit 2017', NULL, NULL, '2017-04-01', '2017-04-01', 'Manila Marriott Hotel', NULL, NULL, 36, 45),
(7, 'Demo: Data Privacy Forum with National Privacy Commission', NULL, NULL, '2017-05-23', '2017-05-23', 'Bayanihan Center, JY Hall A', NULL, NULL, 41, NULL),
(8, 'Data Privacy Forum with National Privacy Commission', NULL, NULL, '2017-05-25', '2017-05-25', 'Bayanihan Center, JY Hall A', NULL, NULL, 44, NULL),
(9, '2017 LRP Input Session', NULL, NULL, '2017-07-04', '2017-07-04', 'Bayanihan Center, MK Tan Hall / Rooms BCD', NULL, '<p>\n					The Portfolio Development and Business Analytics (PDBA) Team welcomes you to the 2017 LRP Input Session. Today is an opportunity for learning and a chance for dialogue with both industry experts and our very own Unilab corporate leaders  to gain valuable insights that we can use as inputs to our company’s upcoming long range planning.\n				</p>\n				<p>\n					For this year, we shall focus on how we can ensure least leakage in each stage of the patients’ journey through effective execution.  With Unilab’s strategic initiatives in place, effective execution is key to ensure achievement of growth and profitability objectives.  Strategy is deciding what to do; effective execution is all about making it happen.  Effective execution should happen in the details of our everyday work. It means we follow through on our actions, big and small, so that we are not just doing what we intend to do but are actually realizing the goals we intend to achieve.\n				</p>\n				<p>\n					With these, the first part of the plenary will give a macro view of the healthcare industry wherein our speakers will discuss government plans and regulatory policies, and also regional trends that may impact the way we operate our healthcare business.  We will have an interesting discussion on how we can better engage our customers by understanding their needs and behavior by generation.  We will also uncover the successes and challenges of a former competitor (who is now part of Unilab) so we can derive learnings on how we can better fight competition.\n				</p>\n				<p>\n					In the afternoon, we have lined-up topics on different models of execution .  There will be a brief discussion on the “Framework of the Models of Execution” which is anchored on the on the different stages of the Patient Journey.  This will be followed by actual illustrations of successful program executions such as   Medichem’s  Lingap Diwa,  LRTH’s CRM/ I-Comply,  and the POS business programs of SC&amp;D.  We have also invited Mr. Rhais Gamboa to discuss their programs on how we can optimize our partnership with institutions and MDs at point of care.   There are also special topics such as “Digital Marketing” to gain insights on how we can leverage on technology to better engage with our main customers, - both doctors and end-consumers. Lastly, with the business direction to participate in the Clinical Nutrition Business so we can offer another treatment modality other than pharmaceutical, we have also invited speakers to discuss the topics - “Balancing Body Chemistry through Nutrition” and “Nutrition Therapy in the Clinics.”\n				</p>\n				<p>\n					Indeed, we look forward to an insightful and interactive plenary session.  We are highly encouraging all participants to ask questions to the speakers via InterACT – a PDBA-developed interactive Q&amp;A platform that also allows us to download presentation materials.  This can be easily accessed through your tablets or smartphones.\n				</p>\n				<p>\n					Once again, welcome to this year’s LRP Input Session and we hope that you will maximize the learning from today’s plenary, as well as the upcoming breakout sessions for the segment reviews.\n				</p>\n				<p>\n					Thank you and Good Morning!\n				</p>\n				<p>\n					<b>Ma. Evelyn V. Aguilar</b>\n					<br />\n					Operating Vice President\n					<br />\n					Portfolio Development and Business Analytics\n				</p>', NULL, NULL),
