(162, '6. Seorang wanita 20 tahun, primigravida pada usia kehamilan 18 minggu datang kepada Anda setelah merasa ada cairan merembes dari vagina. Melalui pemeriksaan, Anda memastikan adanya ketuban pecah dini. Pemeriksaan ultrasonografi mendeteksi oligohidramnion. Pada kasus ini, keselamatan perinatal menjadi hal yang sangat sulit terjadi dikarenakan tidak berkembangnya organ', 115, 0),
