(165, '9. Beberapa jenis antibiotik telah digunakan pada ibu hamil preterm dengan ketuban pecah dini yang menjalani terapi konservatif. Antibiotik apa yang harus dihindari pada kasus ini karena terbukti berhubungan dengan peningkatan risiko terjadinya enterokolitis nekrotikans pada bayi baru lahir?', 115, 0),
